import React from 'react';

function ImagePopup(props){
    return (
        <div id="popup-img" className="popup popup_img">
            <div className="popup__figure">
                <button id="close-img" type="button" className="popup__close" aria-label="Закрыть карточку"></button>
                <img src={props.src} alt="Фотография карточки"
                     className="popup__image"/>
                <p className="popup__caption"/>
            </div>
        </div>
    )
}

export default ImagePopup
